package fastjson_test

import (
	"testing"

	"github.com/your_package_path/fastjson"
)

func TestVisit(t *testing.T) {
	obj := &fastjson.Object{
		kvs: []fastjson.kv{
			{k: "key1", v: &fastjson.Value{s: "value1"}},
			{k: "key2", v: &fastjson.Value{s: "value2"}},
		},
		keysUnescaped: false,
	}

	visitedKeys := []string{}
	visitedValues := []string{}

	obj.Visit(func(key []byte, v *fastjson.Value) {
		visitedKeys = append(visitedKeys, string(key))
		visitedValues = append(visitedValues, v.s)
	})

	expectedKeys := []string{"key1", "key2"}
	expectedValues := []string{"value1", "value2"}

	for i := 0; i < len(expectedKeys); i++ {
		if visitedKeys[i] != expectedKeys[i] {
			t.Errorf("Expected key %s, but got %s", expectedKeys[i], visitedKeys[i])
		}
		if visitedValues[i] != expectedValues[i] {
			t.Errorf("Expected value %s, but got %s", expectedValues[i], visitedValues[i])
		}
	}
}

