func TestMarshalTo(t *testing.T) {
	tests := []struct {
		name string
		v    *Value
		dst  []byte
		want []byte
	}{
		{
			name: "RawString",
			v: &Value{
				s: "hello",
				t: typeRawString,
			},
			dst: []byte{},
			want: []byte(`"hello"`),
		},
		{
			name: "Object",
			v: &Value{
				o: Object{
					kvs: []kv{
						{k: "key1", v: &Value{s: "value1", t: TypeString}},
						{k: "key2", v: &Value{s: "value2", t: TypeString}},
					},
				},
				t: TypeObject,
			},
			dst: []byte{},
			want: []byte(`{"key1":"value1","key2":"value2"}`),
		},
		{
			name: "Array",
			v: &Value{
				a: []*Value{
					{t: TypeString, s: "value1"},
					{t: TypeString, s: "value2"},
				},
				t: TypeArray,
			},
			dst: []byte{},
			want: []byte(`["value1","value2"]`),
		},
		{
			name: "String",
			v: &Value{
				s: "hello",
				t: TypeString,
			},
			dst: []byte{},
			want: []byte(`"hello"`),
		},
		{
			name: "Number",
			v: &Value{
				s: "42",
				t: TypeNumber,
			},
			dst: []byte{},
			want: []byte(`42`),
		},
		{
			name: "True",
			v: &Value{
				t: TypeTrue,
			},
			dst: []byte{},
			want: []byte(`true`),
		},
		{
			name: "False",
			v: &Value{
				t: TypeFalse,
			},
			dst: []byte{},
			want: []byte(`false`),
		},
		{
			name: "Null",
			v: &Value{
				t: TypeNull,
			},
			dst: []byte{},
			want: []byte(`null`),
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got := tt.v.MarshalTo(tt.dst)
			if !reflect.DeepEqual(got, tt.want) {
