package fastjson

import (
	"fmt"
	"testing"
)

func TestParseArray(t *testing.T) {
	tests := []struct {
		name   string
		input  string
		output *Value
		err    error
	}{
		{
			name:  "Empty Array",
			input: "[]",
			output: &Value{
				t: TypeArray,
				a: []*Value{},
			},
			err: nil,
		},
		{
			name:  "Array with Values",
			input: "[1, \"hello\", true]",
			output: &Value{
				t: TypeArray,
				a: []*Value{
					{t: TypeNumber, s: "1"},
					{t: TypeString, s: "hello"},
					{t: TypeTrue},
				},
			},
			err: nil,
		},
		{
			name:  "Nested Arrays",
			input: "[[1, 2], [3, 4]]",
			output: &Value{
				t: TypeArray,
				a: []*Value{
					{
						t: TypeArray,
						a: []*Value{
							{t: TypeNumber, s: "1"},
							{t: TypeNumber, s: "2"},
						},
					},
					{
						t: TypeArray,
						a: []*Value{
							{t: TypeNumber, s: "3"},
							{t: TypeNumber, s: "4"},
						},
					},
				},
			},
			err: nil,
		},
		{
			name:  "Missing Closing Bracket",
			input: "[1, 2, 3",
			output: nil,
			err:    fmt.Errorf("missing ']'"),
		},
		{
			name:  "Unexpected End of Array",
			input: "[1, 2,",
			output: nil,
			err:    fmt.Errorf("unexpected end of array"),
		},
		{
			name:  "Missing Comma",
			input: "[1 2]",
			output: nil,
			err:    fmt.Errorf("missing ',' after array value"),
		},
	}

	c := &cache{vs: make([]Value, 10)}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			v, _, err := parseArray(tt.input, c, 0)

			if err != nil && tt.err != nil {
				if err.Error() != tt.err.Error() {
					t.Errorf("Expected error: %v, got: %v", tt.err, err)
				}
			} else if err != nil || tt.err != nil {
				t.Errorf("Expected error: %v, got: %v", tt.err, err)
			}

			if !compareValues(v, tt.output) {
				t.Errorf("Expected output: %v, got: %v", tt.output, v)
			}
		})
	}
}

func compareValues(v1, v2 *Value) bool {
	if v1 == nil && v2 == nil {
		return true
	}
	if v1 == nil || v2 == nil {
		return false
	}
	if v1.t != v2.t {
		return false
	}
	if v1.s != v2.s {
		return false
	}
	if len(v1.a) != len(v2.a) {
		return false
	}
	for i := range v1.a {
		if !compareValues(v1.a[i], v2.a[i]) {
			return false
		}
	}
	return true
}

