import (
	"testing"

	"github.com/path/to/fastjson"
)

func TestParseRawString(t *testing.T) {
	tests := []struct {
		input          string
		expectedPrefix string
		expectedSuffix string
		expectedError  string
	}{
		{"\"hello\", world", "hello", ", world", ""},
		{"\"hello\\\"\", world", "hello\\\"", ", world", ""},
		{"\"hello", "", "", "missing closing '\"'"},
	}

	for _, tt := range tests {
		prefix, suffix, err := fastjson.ParseRawString(tt.input)

		if prefix != tt.expectedPrefix {
			t.Errorf("Expected prefix: %s, but got: %s", tt.expectedPrefix, prefix)
		}

		if suffix != tt.expectedSuffix {
			t.Errorf("Expected suffix: %s, but got: %s", tt.expectedSuffix, suffix)
		}

		if err != nil && err.Error() != tt.expectedError {
			t.Errorf("Expected error: %s, but got: %s", tt.expectedError, err.Error())
		}
	}
}

