package fastjson_test

import (
	"fmt"
	"testing"

	"github.com/your/module/fastjson"
)

func TestParseArray(t *testing.T) {
	s := "[1, 2, 3]"
	c := &fastjson.Cache{}
	depth := 0

	val, remaining, err := fastjson.ParseArray(s, c, depth)

	if err != nil {
		t.Errorf("Error parsing array: %v", err)
	}

	if remaining != "" {
		t.Errorf("Expected empty remaining string, got: %s", remaining)
	}

	if val.Type() != fastjson.TypeArray {
		t.Errorf("Expected parsed value to be an array, got: %v", val.Type())
	}

	arr := val.Array()
	if len(arr) != 3 {
		t.Errorf("Expected array length to be 3, got: %d", len(arr))
	}

	expectedValues := []int{1, 2, 3}
	for i, v := range arr {
		num, err := v.Int()
		if err != nil {
			t.Errorf("Error getting int value from array: %v", err)
		}
		if num != expectedValues[i] {
			t.Errorf("Expected value at index %d to be %d, got: %d", i, expectedValues[i], num)
		}
	}
}

