package fastjson

import (
	"testing"
)

func TestGetInt(t *testing.T) {
	// Test case 1: Existing key path with valid int value
	v := &Value{s: "123", t: TypeNumber}
	result := v.GetInt("key1", "key2")
	if result != 123 {
		t.Errorf("Expected: 123, Got: %d", result)
	}

	// Test case 2: Non-existing key path
	v = &Value{s: "456", t: TypeNumber}
	result = v.GetInt("key3", "key4")
	if result != 0 {
		t.Errorf("Expected: 0, Got: %d", result)
	}

	// Test case 3: Invalid value type
	v = &Value{s: "abc", t: TypeString}
	result = v.GetInt("key5")
	if result != 0 {
		t.Errorf("Expected: 0, Got: %d", result)
	}
}

