package fastjson

import (
	"fmt"
	"testing"
)

func TestParseValue(t *testing.T) {
	c := &cache{}
	depth := 0

	tests := []struct {
		input    string
		expected *Value
	}{
		{`"test"`, &Value{t: typeRawString, s: "test"}},
		{`true`, valueTrue},
		{`false`, valueFalse},
		{`null`, valueNull},
		{`123`, &Value{t: TypeNumber, s: "123"}},
		{`{}`, &Value{t: TypeObject}},
		{`[]`, &Value{t: TypeArray}},
	}

	for _, test := range tests {
		v, _, err := parseValue(test.input, c, depth)
		if err != nil {
			t.Errorf("Error parsing value: %v", err)
		}

		if v.t != test.expected.t || v.s != test.expected.s {
			t.Errorf("Expected value %v, but got %v", test.expected, v)
		}
	}
}

