package fastjson

import (
	"fmt"
	"testing"
)

func TestParseValue(t *testing.T) {
	c := &cache{}
	depth := 0

	tests := []struct {
		input    string
		expected *Value
	}{
		{input: `{"key": "value"}`, expected: &Value{t: TypeObject}},
		{input: `["value1", "value2"]`, expected: &Value{t: TypeArray}},
		{input: `"string"`, expected: &Value{t: typeRawString}},
		{input: `true`, expected: valueTrue},
		{input: `false`, expected: valueFalse},
		{input: `null`, expected: valueNull},
		{input: `123`, expected: &Value{t: TypeNumber}},
	}

	for _, test := range tests {
		v, _, err := parseValue(test.input, c, depth)
		if err != nil {
			t.Errorf("Error parsing input %q: %v", test.input, err)
		}
		if v.t != test.expected.t {
			t.Errorf("Expected type %v, got %v for input %q", test.expected.t, v.t, test.input)
		}
	}
}

