package fastjson_test

import (
	"fmt"
	"testing"

	"github.com/path/to/fastjson"
)

func TestParseRawNumber(t *testing.T) {
	tests := []struct {
		input          string
		expectedNumber string
		remaining      string
		expectedError  error
	}{
		{"123.45", "123.45", "", nil},
		{"-678.90", "-678.90", "", nil},
		{"3.14159e10", "3.14159e10", "", nil},
		{"-2.71828E-5", "-2.71828E-5", "", nil},
		{"+42", "+42", "", nil},
		{"inf", "inf", "", nil},
		{"-inf", "-inf", "", nil},
		{"nan", "nan", "", nil},
		{"123abc", "123", "abc", nil},
		{"", "", "", fmt.Errorf("unexpected char: %q", "")},
	}

	for _, test := range tests {
		number, remaining, err := fastjson.ParseRawNumber(test.input)

		if number != test.expectedNumber {
			t.Errorf("Expected number: %s, got: %s", test.expectedNumber, number)
		}

		if remaining != test.remaining {
			t.Errorf("Expected remaining: %s, got: %s", test.remaining, remaining)
		}

		if (err == nil && test.expectedError != nil) || (err != nil && test.expectedError == nil) || (err != nil && test.expectedError != nil && err.Error() != test.expectedError.Error()) {
			t.Errorf("Expected error: %v, got: %v", test.expectedError, err)
		}
	}
}
